import React, { Component } from 'react'

class MiniPalette extends Component {
    render(){
        const {paletteName, colors, id, emoji } = this.props;
        return(
            <div className="MiniPalette">
                {this.props.paletteName}
            </div>
        )
    }
}

export default MiniPalette;
